import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('futura-condensedmedium_bigfontsite.com-normal.ttf', font);
this.addFont('futura-condensedmedium_bigfontsite.com-normal.ttf', 'futura-condensedmedium_bigfontsite.com', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
